export const Tareas = () => {
  return (
    <div className='tareas-container'>
        <h1>Mis tareas</h1>
        <form>
            <input type='text' name='titulo' placeholder='Describe la tarea'/>
            <input type='submit' value='Guardar' />
        </form>
    </div>
  )
}
